import "./Expense.css";
import ExpenseItem from "./ExpenseItem";

function Expense(props) {
  return (
    <div className="expenses">
      {props.map((props, index) => {
        return (
          <ExpenseItem
            date={props.data.date}
            title={props.data.title}
            amount={props.data.ampunt}
          ></ExpenseItem>
        );
      })}
    </div>
  );
}

export default Expense;
